import React from 'react'
import styled from '@emotion/styled'
import { ReactComponent as UpIcon } from '../icons/up.svg'

const WelcomeText = styled.h2({
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    fontStyle: 'normal',
    fontWeight: '500',
    fontSize: '48px',
    marginTop: '0',
    marginBottom: '150px',

    '& h2': {
        color: 'rgba(0, 0, 0, 0.75)',
        margin: '0',
    },

    '& h3': {
        margin: '0',
        color: 'rgba(0, 0, 0, 0.50)',
    },

})

const SearchBar = styled.div({
    display: 'flex',
    position: 'relative',
    width: '740px',
})

const SearchBarInput = styled.input({
    flex: '1',
    borderRadius: '23px',
    paddingLeft: '2rem',
    height: '84px',
    border: '1px solid rgba(0, 0, 0, 0.35)',
    fontSize: '24px',

    '&:focus': {
        outline: 'none',
        border: '1px solid rgba(0, 0, 0, 0.75)',
    },
})

const SearchIcon = styled.img({
    position: 'absolute',
    right: '0rem',
    scale: '.35',
    filter: 'brightness(1)',


})

const Search = () => {
    return (
        <>
            <WelcomeText>
                <h2>Hello, Dani</h2>
                <h3>Just a quick check in</h3>
            </WelcomeText>

            <SearchBar>
                <SearchBarInput type='text' placeholder='Chat with CynchAI...'>
                </SearchBarInput>
                <UpIcon fill='red' />
                {/* <SearchIcon src={upIcon} alt="Up Icon" /> */}
            </SearchBar>
        </>
    )
}

export default Search
